//Import React
import React, { useState } from 'react';
//Import Commands
import { StatusBar } from 'expo-status-bar';
import { Text, View, Button, Linking, TextInput } from 'react-native';
//Import Files
import styles from "./Styles";
import { HunterButton } from './Hunter';
import { HuntedButton } from './Hunted';


// MAIN //
export default function App() {

//GeoStates
const [ready, setReady] = useState(flase);
const [where, setWhere] = useState({lat:null, lng:null});
const [error, setError] = useState(null);

  return (
    <View style={styles.body}>
      <StatusBar style="auto" />

      <View style={styles.content1}>
        <Text style={styles.title}>WorldScape</Text>
      </View>

      <View>
        <Text style={styles.text}>Chose a team</Text>
      </View>

      <View style={styles.mainButtons}>
        <HunterButton />
        <HuntedButton />
      </View>

    </View>
  );
}
